import gql from "graphql-tag";

export const MY_PROFILE = gql`
     query MY_PROFILE{
            user {
                        id
                        # username
                        # email
                        profile {
                            id
                            firstname
                            lastname
                            age
                            birthdate
                            mentalStatus
                            profileImage
                        }
                }
        }
  `
